  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Pathfinder National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1957.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  big game animals, furbearers, predators, rodents, and raptors- is also covered.
  The Refuge development and maintenance section discusses physical developments.
  Resource management is outlined; topics include grazing. The public relations section
  of the report describes recreational uses and Refuge participation. N-R forms are
  attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
